import React from "react";
import DeleteIcon from '@mui/icons-material/Delete';

const ToDo = (props)=>{
    return(
        <>
        <div >
        <DeleteIcon/>
        <li>{props.element}</li>
        
       
        </div>

        </>
    )
}

export default ToDo;
